import React, { useEffect, useState } from 'react';
import Axios from 'axios';
import {BASE_URL}  from '../constants/settings';
import Home from '../components/home/index';

export default function Child() {
  goForFetch = () => {
		alert('hi');
	};

  return (
    <Home/>
  );
}
